//Householder
void Householder(double *a,int n, double* q, double* b, double* c)
{
    int i, j, k, u, v;
    double h, f, g, h2;
    for (i = 0; i <= n - 1; i++)
        for (j = 0; j <= n - 1; j++)
        {
            u = i * n + j;
            q[u] = a[u];
        }
    for (i = n - 1; i >= 1; i--)
    {
        h = 0.0;
        if (i > 1)
            for (k = 0; k <= i - 1; k++)
            {
                u = i * n + k;
                h = h + q[u] * q[u];
            }
        if (h + 1.0 == 1.0)
        {
            c[i] = 0.0;
            if (i == 1)
                c[i] = q[i * n + i - 1];
            b[i] = 0.0;
        }
        else
        {
            c[i] = sqrt(h);
            u = i * n + i - 1;
            if (q[u] > 0.0)
                c[i] = -c[i];
            h = h - q[u] * c[i];
            q[u] = q[u] - c[i];
            f = 0.0;
            for (j = 0; j <= i - 1; j++)
            {
                q[j * n + i] = q[i * n + j] / h;
                g = 0.0;
                for (k = 0; k <= j; k++)
                    g = g + q[j * n + k] * q[i * n + k];
                if (j + 1 <= i - 1)
                    for (k = j + 1; k <= i - 1; k++)
                        g = g + q[k * n + j] * q[i * n + k];
                c[j] = g / h;
                f = f + g * q[j * n + i];
            }
            h2 = f / (h + h);
            for (j = 0; j <= i - 1; j++)
            {
                f = q[i * n + j];
                g = c[j] - h2 * f;
                c[j] = g;
                for (k = 0; k <= j; k++)
                {
                    u = j * n + k;
                    q[u] = q[u] - f * c[k] - g * q[i * n + k];
                }
            }
            b[i] = h;
        }
    }
    for (i = 0; i <= n - 2; i++)
        c[i] = c[i + 1];
    c[n - 1] = 0.0;
    b[0] = 0.0;
    for (i = 0; i <= n - 1; i++)
    {
        if ((b[i] != 0.0) && (i - 1 >= 0))
            for (j = 0; j <= i - 1; j++)
            {
                g = 0.0;
                for (k = 0; k <= i - 1; k++)
                    g = g + q[i * n + k] * q[k * n + j];
                for (k = 0; k <= i - 1; k++)
                {
                    u = k * n + j;
                    q[u] = q[u] - g * q[k * n + i];
                }
            }
        u = i * n + i;
        b[i] = q[u];
        q[u] = 1.0;
        if (i - 1 >= 0)
            for (j = 0; j <= i - 1; j++)
            {
                q[i * n + j] = 0.0;
                q[j * n + i] = 0.0;
            }
    }
    return;
}

//QR
int QR(int N, double *b, double *c, double *q, double eps, int limit)
{
    // N 为矩阵阶数
    // b[] 为主对角线元素
    // c[] 为次对角线元素

    int l, u, v;
    double h, p, r;
    double f = 0.0;
    for (int k = 0; k <= N - 1; k++)
    {
        do{
            double g = b[k];
            // (b[k+1] - b[k]) / (2 * c[k])
            p = (b[k + 1] - g) / (2.0 * c[k]);
            r = sqrt(p * p + 1.0);
            if (p >= 0.0)
                b[k] = c[k] / (p + r);
            else
                b[k] = c[k] / (p - r);
            h = g - b[k];

            for (int i = k + 1; i <= N - 1; i++)
                b[i] = b[i] - h;
            f = f + h;

            p = b[N-1];

            double e = 1.0;
            double s = 0.0;
            for (int i = N - 2; i >= k; i--)
            {
                g = e * c[i];
                h = e * p;
                if (fabs(p) >= fabs(c[i]))
                {
                    e = c[i] / p;
                    r = sqrt(e * e + 1.0);
                    c[i + 1] = s * p * r;
                    s = e / r;
                    e = 1.0 / r;
                }
                else
                {
                    e = p / c[i];
                    r = sqrt(e * e + 1.0);
                    c[i + 1] = s * c[i] * r;
                    s = 1.0 / r;
                    e = e / r;
                }
                p = e * b[i] - s * g;
                b[i + 1] = h + s * (e * g + s * b[i]);
                
                //==============================================
                for (l = 0; l <= N - 1; l++)
                {
                    u = l * N + i + 1;
                    v = u - 1;
                    h = q[u];
                    q[u] = s * q[v] + e * h;
                    q[v] = e * q[v] - s * h;
                }
                //==============================================
            }
            c[k] = s * p;
            b[k] = e * p;
        } while (fabs(c[k]) > eps);
        
        b[k] = b[k] + f;
    }

    for (int i = 0; i <= N - 1; i++)
    {
        l = i;
        p = b[i];
        if (i + 1 <= N - 1)
        {
            int k = i + 1;
            while ((k <= N - 1) && (b[k] <= p))
            {
                l = k;
                p = b[k];
                k++;
            }
        }
        if (l != i)
        {
            b[l] = b[i];
            b[i] = p;
            for (int k = 0; k <= N - 1; k++)
            {
                u = k * N + i;
                v = k * N + l;
                p = q[k * N + i];
                q[k * N + i] = q[k * N + l];
                q[k * N + l] = p;
            }
        }
    }
    return (1);
}

//排序
void sort(double A[],int N)
{
    double temp = 0.0;
    for (int i = 0; i < N; i++)
    {
        for (int j = 0; j < N - i - 1; j++)
        {
            if (A[j] > A[j + 1])
            {
                temp = A[j];
                A[j] = A[j + 1];
                A[j + 1] = temp;
            }
        }
    }
}

//随机Her矩阵生成
void symmat(double H[], int N)
{
    int n=N/2;
    double *A = new double[n * n];
    double *B = new double[n * n];

    srand((unsigned)time(NULL));
    for (int i = 0; i < n; i++)
    {
        for(int j=0 ;j< n; j++){
            if(j >= i){
                A[i * n + j] = rand()%100 / double((101)) *10;
                B[i * n + j] = rand()%100 / double((101)) *10;
            }
            else{
                A[i * n + j] = A[j * n + i];
                B[i * n + j] = -1 * B[j * n + i];
            }
        }
        B[i*n+i]=0;
    }

    // show(A,n);
    // printf("\n");
    // show(B,n);
    // printf("\n");

    for (int i = 0; i < N; i++)
    {
        for(int j = 0;j <N ;j++)
        {
            if((i>=n&&j>=n)||(i<n && j<n)) 
                H[i*N+j]= A[i%n * n + j%n];
            else if(i<n)
                H[i*N+j]= -1 * B[i%n * n + j%n];
            else
                H[i*N+j]= B[i%n * n + j%n];
        }
    }
}

